set output = "updated" _ $CHAR(13, 10) set stream=##class(%Stream.FileBinary).%New() set sc=stream.LinkToFile(watch) do stream.MoveTo(..WatchesCaret(watch, 0) + 1) set readed = stream.Read(size - ..WatchesCaret(watch, 0)) set output=output_readed set ..WatchesCaret(watch, 0) = size set ..WatchesCaret(watch, 1) = file.DateModified
} elseif ((size < ..WatchesCaret(watch, 0)) || (file.DateModified '= ..WatchesCaret(watch, 1))) {
set output = "modified" _ $CHAR(13, 10) set output = output _ "Bytes changed: " _ (size - ..WatchesCaret(watch, 0)) set ..WatchesCaret(watch, 0) = size set ..WatchesCaret(watch, 1) = file.DateModified
